control.onUpdate:
var cell;
if ((eb.isEmpty(g5.dataset1)) || (g5.dataset1.getData(0, sender.rowIndex).length==0)) {
    for (var i = 0; i < sender.parentNode.colCount; i++) {
        cell = ee.getTableCell(sender.parentNode, i, sender.rowIndex);
        ee.setText(cell, "");
    }
    return;
}

var sTemp;

//序号
cell = ee.getTableCell(sender.parentNode, 0, sender.rowIndex);
ee.setText(cell, g5.dataset1.getData(0, sender.rowIndex));

//登记时间
cell = ee.getTableCell(sender.parentNode, 1, sender.rowIndex);
ee.setText(cell, g5.dataset1.getData(1, sender.rowIndex));

//状态
cell = ee.getTableCell(sender.parentNode, 2, sender.rowIndex);
sTemp = g5.dataset1.getData(2, sender.rowIndex)
if (sTemp == "NEW") {
    sTemp = "观望";
} else if (sTemp == "RSV") {
    sTemp = "已预定";
} else if (sTemp == "PAY") {
    sTemp = "已付款";
} else if (sTemp == "删除") {
}
ee.setText(cell, sTemp);

//机票序号
cell = ee.getTableCell(sender.parentNode, 3, sender.rowIndex);
ee.setText(cell, g5.dataset1.getData(3, sender.rowIndex));

//乘客信息
cell = ee.getTableCell(sender.parentNode, 4, sender.rowIndex);
ee.setText(cell,
    "<font color = '#d03030'>" + g5.dataset1.getData(4, sender.rowIndex) + "</font>" +
    "(" + g5.dataset1.getData(5, sender.rowIndex) + ")<br/>" +
    g5.dataset1.getData(6, sender.rowIndex)
    );

//机票信息
cell = ee.getTableCell(sender.parentNode, 5, sender.rowIndex);

if (g5.dataset1.getData(10, sender.rowIndex) == "") {
    ee.setText(cell, "未订票");
} else {
    ee.setText(cell,
        "<font color = '#d03030'>" + g5.dataset1.getData(11, sender.rowIndex) +"</font> " +
        "出发:" + g5.dataset1.getData(12, sender.rowIndex) + " 到达:" + g5.dataset1.getData(13, sender.rowIndex) + " " +
        "价:<font color = '#d03030'>" + g5.dataset1.getData(10, sender.rowIndex) +"</font><br/>" +
        "出发:<font color = '#d03030'>" + g5.dataset1.getData(14, sender.rowIndex) + " " + g5.dataset1.getData(15, sender.rowIndex) +"</font>" +
        g5.dataset1.getData(16, sender.rowIndex) + "(" + g5.dataset1.getData(17, sender.rowIndex) + ")" +
        g5.dataset1.getData(18, sender.rowIndex) + "(" + g5.dataset1.getData(19, sender.rowIndex) + ")<br/>" +
        "到达:<font color = '#d03030'>" + g5.dataset1.getData(20, sender.rowIndex) + " " + g5.dataset1.getData(21, sender.rowIndex) +"</font>" +
        g5.dataset1.getData(22, sender.rowIndex) + "(" + g5.dataset1.getData(23, sender.rowIndex) + ")" +
        g5.dataset1.getData(24, sender.rowIndex) + "(" + g5.dataset1.getData(25, sender.rowIndex) + ")" +
        ""
        );
}

//备注
cell = ee.getTableCell(sender.parentNode, 6, sender.rowIndex);
ee.setText(cell, g5.dataset1.getData(7, sender.rowIndex));

